      } else {
        this.errors = result.getErrors();
      }

      const redirect = result.getRedirect();

      if (redirect) {
        setTimeout(() => {
          return this.router.navigateByUrl(redirect);
        }, this.redirectDelay);
      }

      this.cd.detectChanges();
    });
  }

  getConfigValue(key) {
    return getDeepFromObject(this.options, key, null);
  }

}

